import React from 'react';
import './Skills.css';
import git from '../assets/git.png';
import c from '../assets/c++.png';
import java from '../assets/java.png';
import csharp from '../assets/c-sharp.png';
import sql from '../assets/database.png';
import unity from '../assets/unity.png';
import python from '../assets/python.png';
import jira from '../assets/jira.png';
import vs from '../assets/visual-studio.png';

function Skills() {
	return (
		<div className="skills-wrapper">
			<div className="skills-header">
				<h1>My Skills</h1>
			</div>
			<div className="skill-icons">
				<div className="icon">
					<img
			            src={git}
			            alt="Icon"
					/>
					 <span className="tooltip-text" id="top" style={{left: '0%'}}>React</span>
				</div>
				<div className="icon">
					<img
			            src={c}
			            alt="Icon"
					/>
				</div>
				<div className="icon">
					<img
			            src={java}
			            alt="Icon"
					/>
				</div>
				<div className="icon">
					<img
			            src={csharp}
			            alt="Icon"
					/>
				</div>
				<div className="icon">
					<img
			            src={sql}
			            alt="Icon"
					/>
				</div>
				<div className="icon">
					<img
			            src={unity}
			            alt="Icon"
					/>
				</div>
				<div className="icon">
					<img
			            src={python}
			            alt="Icon"
					/>
				</div>
				<div className="icon">
					<img
			            src={jira}
			            alt="Icon"
					/>
				</div>
				<div className="icon">
					<img
			            src={vs}
			            alt="Icon"
					/>
				</div>
			</div>
		</div>
	);
}

export default Skills;
